CREATE  FUNCTION `QRB`(gridsquare1 VARCHAR(6), gridsquare2 VARCHAR(6)) RETURNS smallint(6)
BEGIN
RETURN CAST(6372.797*SQRT((RADIANS(grid2lat(gridsquare2))-RADIANS(grid2lat(gridsquare1)))*(RADIANS(grid2lat(gridsquare2))-RADIANS(grid2lat(gridsquare1)))+COS(RADIANS(grid2lat(gridsquare2)))*COS(RADIANS(grid2lat(gridsquare1)))*(RADIANS(grid2long(gridsquare2))-RADIANS(grid2long(gridsquare1)))*(RADIANS(grid2long(gridsquare2))-RADIANS(grid2long(gridsquare1)))) AS UNSIGNED);
END ;;
