CREATE  FUNCTION `score`(log SMALLINT) RETURNS mediumint(9)
BEGIN
  DECLARE scoreline MEDIUMINT UNSIGNED;
  DECLARE grid VARCHAR(6);
  SELECT id2wwl(wwlID) INTO grid FROM logs WHERE logID = log LIMIT 1;
  SELECT multiplier(log)*IFNULL(SUM(GREATEST(QRB(gridsquare, grid),1)),0) + 500*grids(log) INTO scoreline FROM qsorecords WHERE logID = log AND (confirm = 16 OR confirm = 32 OR confirm = 71) LIMIT 1;
  RETURN scoreline;
END ;;
